        cost[L - 1][R] = min(cost[L - 1][R], C)
    for L in range(n - 1):
        for R in range(1, n + 1):
            cost[R][L] = min(cost[R][L], cost[R - 1][L])
    dp = [[10 ** 18 for _ in range(n + 1)] for _ in range(n + 1)]
    for i in range(n):
        dp[i][0] = 0
