        for j in range(i + 1):
            if dp[i][j] < 10 ** 18:
                dp[i + 1][j] = min(dp[i + 1][j], dp[i][j])
                for k in range(i + 1, n + 1):
                    dp[k][j + k - i] = min(dp[k][j + k - i], dp[i][j] + cost[i][k])
    ans = dp[n][k]
    return ans if ans < 10 ** 18 else -1

